<style>
  @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300;400;700&family=Lora:wght@400;700&display=swap');

  :root {
    --primary-color: #4a90e2;
    --secondary-color: #f39c12;
    --text-color: #333;
    --background-color: #ffffff;
    --accent-color: #e74c3c;
  }

  body, html {
    margin: 0;
    padding: 0;
    height: 100%;
    font-family: 'Raleway', sans-serif;
    background-color: var(--background-color);
    color: var(--text-color);
    overflow-x: hidden;
  }

  .container {
    max-width: 1200px;
    margin: 0 auto;
    padding: 2rem;
    position: relative;
  }

  header {
    text-align: center;
    margin-bottom: 3rem;
  }

  h1 {
    font-family: 'Lora', serif;
    font-size: 4.5rem;
    margin-bottom: 1rem;
    background: linear-gradient(45deg, var(--primary-color), var(--secondary-color));
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    animation: titleShimmer 5s linear infinite;
  }

  @keyframes titleShimmer {
    0% {
      background-position: -200% center;
    }
    100% {
      background-position: 200% center;
    }
  }

  .content {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
    gap: 2.5rem;
  }

  .card {
    background: rgba(255, 255, 255, 0.7);
    border-radius: 20px;
    padding: 2.5rem;
    text-align: center;
    transition: all 0.5s ease;
    position: relative;
    overflow: hidden;
    backdrop-filter: blur(10px);
    box-shadow: 0 8px 32px rgba(31, 38, 135, 0.15);
  }

  .card::before {
    content: '';
    position: absolute;
    top: -50%;
    left: -50%;
    width: 200%;
    height: 200%;
    background: radial-gradient(circle, rgba(255, 255, 255, 0.8) 0%, rgba(255, 255, 255, 0) 70%);
    transform: rotate(30deg);
    pointer-events: none;
    transition: all 0.8s ease;
  }

  .card:hover::before {
    transform: rotate(0deg);
  }

  .card:hover {
    transform: translateY(-15px) scale(1.05);
    box-shadow: 0 15px 40px rgba(31, 38, 135, 0.2);
  }

  .card h2 {
    font-family: 'Lora', serif;
    font-size: 2rem;
    margin-bottom: 1.2rem;
    color: var(--primary-color);
  }

  .card p {
    font-size: 1.1rem;
    margin-bottom: 1.8rem;
    line-height: 1.6;
  }

  .btn {
    display: inline-block;
    padding: 12px 24px;
    background: linear-gradient(45deg, var(--primary-color), var(--secondary-color));
    color: var(--background-color);
    text-decoration: none;
    border-radius: 30px;
    font-weight: bold;
    transition: all 0.4s ease;
    position: relative;
    overflow: hidden;
    font-size: 1.1rem;
  }

  .btn::before {
    content: '';
    position: absolute;
    top: -50%;
    left: -50%;
    width: 200%;
    height: 200%;
    background: radial-gradient(circle, rgba(255,255,255,0.3) 0%, rgba(255,255,255,0) 70%);
    transform: rotate(30deg);
    transition: all 0.6s ease;
    opacity: 0;
  }

  .btn:hover::before {
    opacity: 1;
    transform: rotate(0deg);
  }

  .btn:hover {
    box-shadow: 0 0 30px var(--primary-color);
    transform: scale(1.05);
  }

  .floating-particle {
    position: absolute;
    opacity: 0.6;
    pointer-events: none;
    filter: blur(3px);
  }

  #brightness-overlay {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: radial-gradient(circle at center, rgba(255,255,255,0.9) 0%, rgba(255,255,255,0) 70%);
    pointer-events: none;
    z-index: 9998;
    opacity: 0;
    transition: opacity 0.5s ease;
  }

  #cursor-light {
    width: 400px;
    height: 400px;
    background: radial-gradient(circle, rgba(255, 255, 255, 0.8) 0%, rgba(255, 255, 255, 0) 70%);
    position: fixed;
    pointer-events: none;
    z-index: 9999;
    transition: all 0.1s ease;
    filter: blur(30px);
    mix-blend-mode: screen;
  }

  .blur-content {
    filter: blur(5px);
    transition: filter 0.5s ease;
  }

  .blur-content:hover {
    filter: blur(0);
  }
</style>

  <script>
    // Cursor light and brightness effect
    const cursorLight = document.getElementById('cursor-light');
    const brightnessOverlay = document.getElementById('brightness-overlay');
    
    document.addEventListener('mousemove', (e) => {
      gsap.to(cursorLight, {
        x: e.clientX - 200,
        y: e.clientY - 200,
        duration: 0.2,
        ease: "power2.out"
      });
      
      gsap.to(brightnessOverlay, {
        opacity: 0.2 + (e.clientY / window.innerHeight) * 0.4,
        duration: 0.5
      });
    });

    // Floating particles animation
    const createFloatingParticle = () => {
      const particle = document.createElement('div');
      particle.classList.add('floating-particle');
      particle.style.width = `${Math.random() * 10 + 5}px`;
      particle.style.height = particle.style.width;
      particle.style.background = `rgba(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255}, 0.6)`;
      particle.style.borderRadius = '50%';
      
      gsap.set(particle, {
        x: Math.random() * window.innerWidth,
        y: Math.random() * window.innerHeight
      });
      
      document.body.appendChild(particle);
      
      gsap.to(particle, {
        x: `+=${Math.random() * 300 - 150}`,
        y: `+=${Math.random() * 300 - 150}`,
        scale: Math.random() * 1.5 + 0.5,
        duration: Math.random() * 20 + 10,
        repeat: -1,
        yoyo: true,
        ease: "sine.inOut"
      });
    };

    for (let i = 0; i < 30; i++) {
      createFloatingParticle();
    }

    // Card animations
    const cards = document.querySelectorAll('.card');
    
    cards.forEach((card, index) => {
      gsap.from(card, {
        opacity: 0,
        y: 100,
        rotation: Math.random() * 20 - 10,
        duration: 1.5,
        delay: index * 0.3,
        ease: "elastic.out(1, 0.75)"
      });
    });

    // Button hover effect
    const buttons = document.querySelectorAll('.btn');
    
    buttons.forEach(btn => {
      btn.addEventListener('mouseenter', () => {
        gsap.to(btn, {
          scale: 1.1,
          duration: 0.3,
          ease: "back.out(1.7)"
        });
      });
      
      btn.addEventListener('mouseleave', () => {
        gsap.to(btn, {
          scale: 1,
          duration: 0.3,
          ease: "back.out(1.7)"
        });
      });
    });

    // Parallax effect on scroll
    window.addEventListener('scroll', () => {
      const scrollPosition = window.pageYOffset;
      cards.forEach((card, index) => {
        const speed = 0.1 + (index * 0.05);
        gsap.to(card, {
          y: scrollPosition * speed,
          rotation: scrollPosition * speed * 0.05,
          duration: 0.5,
          ease: "power1.out"
        });
      });
    });

    // Text glow animation
    const title = document.querySelector('h1');
    gsap.to(title, {
      textShadow: "0 0 30px rgba(74, 144, 226, 0.8), 0 0 60px rgba(74, 144, 226, 0.6), 0 0 90px rgba(74, 144, 226, 0.4)",
      duration: 2,
      repeat: -1,
      yoyo: true
    });

    // Card hover effect
    cards.forEach(card => {
      card.addEventListener('mouseenter', () => {
        gsap.to(card, {
          boxShadow: "0 0 40px rgba(74, 144, 226, 0.6)",
          duration: 0.3
        });
      });
      
      card.addEventListener('mouseleave', () => {
        gsap.to(card, {
          boxShadow: "0 8px 32px rgba(31, 38, 135, 0.15)",
          duration: 0.3
        });
      });
    });

    // Subtle background animation
    gsap.to(document.body, {
      background: `linear-gradient(45deg, 
                    ${gsap.utils.interpolate(['#ffffff', '#f0f8ff'], Math.random())}, 
                    ${gsap.utils.interpolate(['#ffffff', '#fff5e6'], Math.random())})`,
      duration: 15,
      repeat: -1,
      yoyo: true,
      ease: "sine.inOut"
    });

    // Animated blur effect
    const blurContents = document.querySelectorAll('.blur-content');
    blurContents.forEach(content => {
      content.addEventListener('mouseenter', () => {
        gsap.to(content, { filter: 'blur(0px)', duration: 0.5 });
      });
      content.addEventListener('mouseleave', () => {
        gsap.to(content, { filter: 'blur(5px)', duration: 0.5 });
      });
    });

    // Brightness pulsation
    gsap.to(brightnessOverlay, {
      opacity: 0.1,
      duration: 2,
      repeat: -1,
      yoyo: true,
      ease: "sine.inOut"
    });

    // Card content reveal animation
    cards.forEach(card => {
      const cardContent = card.querySelector('p');
      const cardButton = card.querySelector('.btn');
      
      gsap.set([cardContent, cardButton], { opacity: 0, y: 20 });
      
      card.addEventListener('mouseenter', () => {
        gsap.to([cardContent, cardButton], {
          opacity: 1,
          y: 0,
          duration: 0.5,
          stagger: 0.1,
          ease: "power2.out"
        });
      });
      
      card.addEventListener('mouseleave', () => {
        gsap.to([cardContent, cardButton], {
          opacity: 0,
          y: 20,
          duration: 0.3,
          ease: "power2.in"
        });
      });
    });

    // Dynamic light rays
    const createLightRay = () => {
      const ray = document.createElement('div');
      ray.style.position = 'absolute';
      ray.style.width = '2px';
      ray.style.height = '100%';
      ray.style.background = 'linear-gradient(to bottom, rgba(255,255,255,0) 0%, rgba(255,255,255,0.8) 50%, rgba(255,255,255,0) 100%)';
      ray.style.left = `${Math.random() * 100}%`;
      ray.style.transform = 'rotate(10deg)';
      document.body.appendChild(ray);

      gsap.to(ray, {
        y: '100%',
        duration: Math.random() * 3 + 2,
        repeat: -1,
        ease: "none",
        onComplete: () => ray.remove()
      });
    };

    setInterval(createLightRay, 1000);
